import React, { useEffect } from 'react';
import { useAuth0 } from '@auth0/auth0-react';
import { useNavigate } from 'react-router-dom';

const AuthCallback = () => {
  const { isAuthenticated } = useAuth0();
  const navigate = useNavigate();

  useEffect(() => {
    if (isAuthenticated) {
      navigate('/');
    }
    // Add else condition if you need to handle the case where the user is not authenticated
  }, [isAuthenticated, navigate]);

  return <div>Loading...</div>; // Consider enhancing this with your actual loading indicator
};

export default AuthCallback;
